function matriculap_panel_click(event, element)
{
    event.preventDefault();
    var matriculap_obj       = document.getElementById('matriculap');
    var matriculap_panel_obj = document.getElementById('matriculap_panel');
    if (matriculap_panel_obj.style.display == 'none')
    {
        matriculap_panel_obj.style.display  = 'block';
        matriculap_obj.addEventListener('mouseover', matriculap_mouseover, false);
        matriculap_obj.addEventListener('mouseout' , matriculap_mouseout,  false);
    }
    else
    {
        matriculap_panel_obj.style.display  = 'none';
        matriculap_obj.removeEventListener('mouseover', matriculap_mouseover, false);
        matriculap_obj.removeEventListener('mouseout' , matriculap_mouseout,  false);
        matriculap_obj.style.opacity = '1';
    }
}

function matriculap_mouseover(event)
