function resetConf()
{
    checkbox.forEach(function (e,i)
    {
        e.checked = false;
        checkbox_checked[i].checked = true;
    });
//    saveConf();
    toogleCheckbox();
}

function resetedConf()
{
    var temp = [];
    checkbox.forEach(function (e,i)
    {
        temp.push({id:      e.id,
                   checked: false,})
    });
    return temp;
}

function saveConf()
{
    var newConf = JSON.stringify({value:     checkbox_checked,
                                  timestamp: new Date()});
    setStorageValue(keySave, newConf);
}

function updatedConf()
{
    var temp = [];
    checkbox.forEach(function (e,i)
    {
        temp.push({id:      e.id,
                   checked: e.checked,})
    });
    return temp;
}

function loadConf()
{
    var storage = JSON.parse(getStorageValue(keySave));
    if (storage !== null && storage !== undefined)
    {
        storage.timestamp = new Date(storage.timestamp);
        var nowTime = new Date();
        if (getValidTimestamp(storage.timestamp, nowTime))
        {
            var find;
            checkbox.forEach(function (e,i)
            {
                find = storage.value.searchObject('id', e.id);
                if (find !== null)
                    e.checked = find.checked;
            });
            checkbox_checked = resetedConf();
            toogleCheckbox();

            var allUnchecked = true;
            checkbox_checked.forEach(function (e,i)
            {
                allUnchecked = allUnchecked && !e.checked;
            })
            if (!allUnchecked)
                document.getElementById('matriculap_panel_click').click();
        }
        else console.log('Sua √∫ltima configura√ß√£o expirou por ter acontecido a mais de 1 m√™s atr√°s.');
    }
    else console.log('N√£o existe configura√ß√£o pr√©via salva para este usu√°rio neste computador.');
}

function getValidTimestamp(time1, time2)
{
    return Math.abs(time1.getMonth() - time2.getMonth()) <= 1;
}

