function insertCSS(css)
{
    var head  = document.head || document.getElementsByTagName('head')[0];
    var style = document.createElement('style');
    style.type = 'text/css';
    if (style.styleSheet)
         style.styleSheet.cssText = css;
    else style.appendChild(document.createTextNode(css));
    head.appendChild(style);
}

function insertElement(type, id, className, innerHTML, onclick, target)
{
    target = getElement(target);
    var element = document.createElement(type);
    if (id != '' && id !== null)
        element.id = id;
    if (className != '' && className !== null)
        element.className = className;
    if (innerHTML !== null && innerHTML != '')
        element.innerHTML = innerHTML;
    if (onclick !== null && onclick != '')
        element.onclick = onclick;
    target.appendChild(element);
    return element;
}

function getElementsById(id, tempid)
{
    if (tempid !== null && tempid != '')
        tempid = id + '_abcdefghijklmnopqrstu918273654_' + id;
    var n = document.getElementById(id);
    var a = [];
    var i;
    while (n)
    {
        a.push(n);
        n.id = tempid;
        n = document.getElementById(id);
    }
    for (i = 0;i < a.length; ++i)
        a[i].id = id;
    return a;
}

function getElement(element)
{
    var elementObj = null;
    if (element !== null)
    {
             if (typeof element == 'string' && element != '')  elementObj = document.getElementById(element);
        else if (typeof element == 'object')                   elementObj = element;
    }
    return elementObj;
}
